import React from 'react';
import logo from '../../img/logo-187x66.png';
import classes from './Navigation.module.css'
import {NavLink} from "react-router-dom";


const  Navigation = () =>{
    return (
        <div className={classes.block}>
            <div className={classes.item_img}>
                <img src={logo} alt=""/>
            </div>
            <div className={classes.item_menu}>
                <ul className={classes.ul}>
                    <li className={classes.li}><NavLink to="/profile" activeClassName={classes.active}>Home</NavLink></li>
                    <li className={classes.li}><NavLink to="/dialog" activeClassName={classes.active}>About</NavLink></li>
                    <li className={classes.li}><NavLink to="/news" activeClassName={classes.active}>Service</NavLink></li>
                    <li className={classes.li}><NavLink to="/music" activeClassName={classes.active}>Portfolio</NavLink></li>
                    <li className={classes.li}><NavLink to="/setting" activeClassName={classes.active}>Blog</NavLink></li>
                    <li className={classes.li}><NavLink to="/setting" activeClassName={classes.active}>Blog</NavLink></li>
                    

                </ul>
            </div>

        </div>
    );
};

export default Navigation;
